<div class="entities" style="line-height: 2.5; direction: ltr">Pharmacological investigation of the role of leukotrienes in the pathogenesis of experimental NSAID gastropathy . The role of leukotrienes in the pathogenesis of acute gastric ulceration induced by nonsteroidal antiinflammatory drugs was investigated using a rat model . One part of the study involved oral pretreatment with a leukotriene synthesis inhibitor 1 h prior to administration of indomethacin ( 20 mg / kg per os ) . Three hours after indomethacin , the extent of macroscopically visible gastric damage was determined , and gastric LTB 4 synthesis was determined . The compounds tested were PF - 5901 , A - 64077 , nordihydroguaiaretic acid , and L -698,037 . Each compound produced dose-related inhibition of gastric LTB 4 synthesis and a parallel reduction in the severity of indomethacin-induced damage . The antioxidant properties of these compounds was assessed using an in vitro assay . There was no correlation between the antioxidant properties of the compounds and their ability to reduce the severity of indomethacin-induced gastric damage . In the second part of the study , the effects of intravenous , administration of LTD 4 and LTB 4 receptor antagonists on indomethacin-induced gastric epithelial damage ( measured by permeability to [ 51Cr ] DB00974 ) were assessed . The two

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Roles of calcitonin gene-related peptide ( P8 0511 ) in hyperpnea-induced constriction in guinea pigs . It has been reported that hyperpnea-induced bronchoconstriction in guinea pigs is a potential model for exercise-induced asthma in humans . We hypothesized that calcitonin gene-related peptide ( P8 0511 ) could modulate leukotriene D4 ( LTD 4 ) - induced responses and be involved in the pathophysiology in this asthma model . We measured tracheal ( Ptr ) and alveolar pressure ( PA ) using alveolar capsules in open-chested , mechanically ventilated ( f = 1 Hz , VT = 9 ml / kg , PEEP = 4 cm H2O ) guinea pigs . Animals were intravenously pretreated with saline ( SAL ) , P8 0511 (8 - 37 ) ( P8 0511 receptor antagonist ) , P8 0511 , MK - 571 (

 antagonist ) , MK - 886 (

 inhibitor ) , or P8 0511 (8 - 37 ) + MK - 571 , and then underwent dry gas hyperpnea challenge ( HC , 95 % 02-5 % CO2 , 150 breaths / min , 7 min ) . We calculated resistance of lung ( RL ) , tissue ( Rti ) , and airway ( Raw ) . HC increased RL , Rti , and Raw in SAL controls ( 322 + / - 27 , 430 + / - 59 , 299 + / - 23 % baseline , respectively ) . MK - 571 , MK - 886 , and P8 0511 significantly reduced the responses to HC , while P8 0511 (8 - 37 ) enhanced HC-induced responses . Pretreatment with P8 0511 (8 - 37 ) and MK - 571 in combination attenuated HC-induced constriction . In addition , pretreatment with P8 0511 reduced responses induced by intravenous administration of LTD 4 . These observations suggest that P8 0511 might be involved in the pathophysiology of hyperpnea-induced constriction in guinea pigs via modulation of LTD 4 - elicited responses .</div>

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Induction of granulocytic differentiation in myeloblasts by hydroquinone , a metabolite of benzene , involves the leukotriene D4 receptor . Chronic exposure of humans to benzene ( BZ ) , a Class I carcinogen , causes acute myelogenous leukemia , possibly via its bone marrow metabolite , hydroquinone ( HQ ) . The ability to alter cytokine-dependent growth and differentiation in hematopoietic stem or progenitor cells appears to be a property of agents with leukemogenic potential . We have previously reported that BZ and HQ specifically stimulate granulopoiesis in mice and cause granulocytic differentiation in normal murine interleukin ( IL ) - 3 - dependent , granulocyte colony-stimulating factor ( DB00099 ) - inducible 32D myeloblasts . BZ induces granulocytic differentiation by upregulating the production of leukotriene D4 ( LTD 4 ) , an essential intracellular mediator of G -

</mark>
 signaling . We report here that HQ ( 0.5- 4.0 microM ) , as well as LTD 4 ( 1 nM - 10 microM ) , causes a concentration-dependent induction of granulocytic differentiation in 32D myeloblasts . Unlike LTD 4 , which induces terminal granulocytic differentiation , HQ undergoes a myeloperoxidase-dependent oxidation to bioreactive p-benzoquinone ( BQ ) , which induces differentiation predominantly to the myelocyte stage . Studies with the highly specific

</mark>
 , thus obviating the requirement for LTD 4 . This was confirmed by the demonstration that HQ , in the presence of LTD 4 , shifts the stage-specific pattern of terminal differentiation induced by LTD 4 to the incomplete ( myelocyte ) profile induced by HQ . The inability of HQ to induce a complete program of terminal granulocytic differentiation in myeloblasts , as well as its ability to compete with induction by LTD 4 , may have a bearing on the leukemogenic potential of BZ .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Leukotriene D4 - induced increases in cytosolic calcium in THP - 1 cells : dependence on extracellular calcium and inhibition with selective leukotriene D4 receptor antagonists . Agonist-induced changes in intracellular calcium ion concentration ( [ Ca + + ] i ) were examined in human monocytic leukemia THP - 1 cells loaded with fura 2 / acetoxymethyl ester ( fura 2 / AM ) . Leukotriene ( LT ) D4 induced a concentration-dependent biphasic response consisting of a transient phase ( up to 5 - fold peak increase ) followed by a sustained phase , showing characteristics of a receptor-operated calcium channel . Homologous desensitization to LTD 4 was observed . The responses to LTD 4 were reduced by 80 to 90 % in calcium-free buffer . The responses to LTD 4 in a calcium-free buffer were dependent upon the duration of prior exposure of the cells to a calcium-free environment . The response at 30 or 60 min after exposure to calcium-free buffer was greater than that at earlier time points ( time-dependent sensitization ) . Similar responses were obtained with THP - 1 cells exposed to DB00974 - containing buffer . It is speculated that such time-dependent sensitization is a result of changes at the receptor level . The responses to LTD 4 were blocked by two specific LTD 4 antagonists , MK - 0571 and
